import React, { useEffect } from "react";
import { preLoaderAnim } from "./animation/loader";
import "../components/style/preloader.css"

function Preloader() {
    useEffect(() => {
      preLoaderAnim();
    }, []);
  return (
    <div className="preloader">
      <div className="texts-container">
        <span>Niyumi </span>
        <span>Anime </span>
        <span>Home</span>
      </div>
    </div>
  );
}

export default preloader;
